English | CBZ | 24 Pages

Wonder Woman v2 #1000000
Publisher:  DC Comics
Publication Date:  November 1998

Writer:  Christopher Priest
Penciller:  Michael Collins
Inker:  John Stokes
Colorist:  Ian Laughlin
Letterer:  Pat Prentice
Cover Artist:  Mike Deodato Jr. and Pat Garrahy

A DC ONE MILLION tie-in! Brought to the Amazon-controlled Venus of the 853rd Century, Wonder Woman's participation in the games celebrating Superman's return turns to disaster when her fellow Amazons of the future are manipulated into believing that Diana may not be the legendary heroine they believe her to be.

Thanks goes to Ok C.O.M.P.U.T.O. for this release.

